import React from "react";
import { Route, Navigate } from "react-router";
import { useSelector } from "react-redux";

export default function PrivateRoute({children, ...rest}){

    const login = useSelector(state=>state);

    return (<Route {...rest}>
        render = {({location}) =>
            login ? (children):
            (<Navigate to ={{
                pathname: "/",
                state: {from: location}
            }}></Navigate>)
        }
    </Route>)
}
